import React, { Component } from 'react';
import './style.css';
import SearchNav from '../SearchNav';
import {Image, Video, Transformation, CloudinaryContext} from 'cloudinary-react';

class Volunteer extends Component {
    constructor(props) {
        super(props)

        this.state = {
            volunteer: {},
        }
    }

    componentDidMount = async() => {
        this.getVolunteer();
    }

    getVolunteer = async() => {
        const volunteer = await(await fetch('/api/volunteer',{
            method: "GET",
            headers:{
                "jwt-token":localStorage.getItem('user-jwt') 
            }
        })).json();
        this.setState({
            volunteer: volunteer
        });
    }

    render() {
        return (
            <div>
                <SearchNav />
                <div className="volunteer-wrapper">
                    <aside className="volunteer-info-wrapper">
                        <h2 className="volunteer-welcome">Welcome {this.state.volunteer.fullName}!</h2>
                        <h3 className="volunteer-score">Your current score is {this.state.volunteer.score}</h3>
                            <div className="volunteer-picture-wrapper">
                            <Image className="volunteer-picture" cloudName="amhouel" publicId={this.state.volunteer.username || ''} width="150" crop="scale"/>
                            </div>
                        <p className="volunteer-info">{this.state.volunteer.username}</p>
                        <p className="volunteer-info">{this.state.volunteer.address}</p>
                        <p className="volunteer-info">{this.state.volunteer.email}</p>
                        <button className="update-button">Update Your Profile</button>
                    </aside>
                    {/* <VolunteerExperience /> */}
                </div>
            </div>
        )
    }
}

export default Volunteer;
